import React from "react";
import Slider from "./Slider/Slider";
import Cards from "./Cards";
import Navbar from "../NavFooter/Navbar";
import Footer from "../NavFooter/Footer";

export default function Contest() {
  return (
    <>
    <Navbar />
      <div className=" pt-16 pb-1  lg:pl-10 pl-0 bg-purple-50">
        <Slider />
      </div>
      <div className=" bg-indigo-100 pt-2 mt-2">
      <span className=" text-center flex pb-4 justify-center items-center text-2xl font-serif text-indigo-800  border-b-2 border-gray-500">Hackathons, Programming Challenges, And Coding Competitions </span>

      <div className="">
        <h1 className=" pl-20 pt-5 text-xl font-bold ">Live Contest: </h1>
        <Cards />
        <h1 className=" pl-20 pt-5 text-xl font-bold">Upcoming Contest: </h1>
        <Cards />
      </div>
      </div>
      <Footer />
    </>
  );
}
